import styled from "styled-components";
import { Button } from "../../../../components/button/Button";

type ProjectType = {
	bgcImage: string;
	projectTheme: string;
	title: string;
	text: string;
	btnLink: string;
	btnTitle: string;
};

export function Project(props: ProjectType) {
	return (
		<StyledProject bgcImage={props.bgcImage}>
			<div>
				<span>{props.projectTheme}</span>
				<Title>{props.title}</Title>
			</div>
			<div id='text'>
				<Text>{props.text}</Text>
				<Button btnTitle={props.btnTitle} btnLink={props.btnLink} />
			</div>
		</StyledProject>
	);
}

type StyledProjectType = {
	bgcImage: string;
};

const StyledProject = styled.div<StyledProjectType>`
	background-image: url(${(props) => props.bgcImage});
	/* background-position: 100% 100%; */
	/* background-size: cover; */
	max-width: 1040px;
	max-height: 447px;
	color: white;
	display: flex;
	gap: 50px;
`;

const Title = styled.h3``;

const Text = styled.p`

`;
